import React from "react";
import './Footer.css';

export default () => {
    return (
        <footer>
            Feito com <span role="img" aria-label="coração">❤️</span> por <a target="_blank" href="https://github.com/rrs6">RRS6</a>, em uma aula de React da B7Web <br/>
            Direitos de imagem para Netflix <br/>
            Dados fornecidos pela API do themoviedb.org
        </footer>
    );
}
